  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for National Bison
  Range outlines Refuge accomplishments from February through April of 1941. The report
  begins by summarizing the weather conditions during this period. Wildlife- including
  migratory birds, upland game birds, big game animals, furbearers, predators, rodents,
  and mammals- is also covered. The Refuge development and maintenance section discusses
  physical developments and plantings. The public relations section of the report
  describes recreational uses and Refuge visitors. Photographs are attached.\",\n\t\"license_title\":
